 'account-id', and 'access-point-name' with your actual values\naccess_point_arn = 'arn:aws:s3:us-west-2:889772541283:accesspoint/8mg1a-s4774'\n\n# Now, use this ARN to get the mapper\n# Append your specific path after the ARN\nmapper = s3.get_mapper(f'{access_point_arn}/8mg1a-s4774/tgw_wrf_rcp85hotter_hourly_2088_default_chunks.zarr')\nds = xr.open_zarr(mapper, consolidated=True)\n\nds.lat.load()\nds.lon.load()\nds.time.load()\n\nstart_date = datetime(2088, 1, 1)\nend_date = datetime(2088, 1, 31)\nvariables=['U10'] #, 'V10'\nstate_abbreviation='wa'\nload=False\n\n# @dask.delayed\ndef process_and_save_data(day_start, day_end):\n    # subset by date\n    # selected_data = ds[variables].sel(time=slice(day_start, day_end))\n    # selecting all vars\n    selected_data = ds.sel(time=slice(day_start, day_end))\n\n    # subset by space\n    # NOTE that there could be errors caused by use of -180 to 180 vs 0 to 360 nomenclature\n    # TODO may want to build in a buffer to be sure to catch the edges of the shape\n    if (state_abbreviation is not None):\n        state_bounds = conus_states[conus_states.STUSPS == state_abbreviation.upper()].bounds.iloc[0]\n        selected_data = selected_data.where(\n            (selected_data.lat&gt;=state_bounds.miny) &amp;\n            (selected_data.lat&lt;=state_bounds.maxy) &amp;\n            (selected_data.lon&gt;=state_bounds.minx) &amp;\n            (selected_data.lon&lt;=state_bounds.maxx),\n            drop=True,\n        )\n\n    file_name = f\"./subset/selected_data_{day_start.strftime('%Y-%m-%d')}.nc\"\n\n    # Save the new dataset to a netCDF file\n    selected_data.to_netcdf(file_name, engine='netcdf4')\n\n# List to store delayed tasks\nfutures = []\n\n# Loop through each day of January\n\nwith performance_report(filename=\"daily-dask-report.html\"):\n    while start_date &lt;= end_date:\n        # Define the start and end dates for the current day\n        day_start = start_date\n        day_end = start_date + timedelta(days=1)\n    \n        # Append delayed task to the list\n        # tasks.append(process_and_save_data(day_start, day_end))\n        # tasks.append(delayed(process_and_save_data)(day_start, day_end))\n        future = client.submit(process_and_save_data, day_start, day_end)\n        futures.append(future)\n    \n        # Move to the next day\n        start_date += timedelta(days=1)\n\n# Execute delayed tasks in parallel\n# dask.compute(*tasks)\n# dask.visualize(dask.compute(*tasks))\n# Wait for all tasks to complete\nfor future in as_completed(futures):\n    # Optional: retrieve results if needed\n    result = future.result()\n\n# Close the client to release resources\nclient.close()\n        &lt;/pre&gt;\n        "}}}},{"type":"object","name":"TabPanel","id":"p1995","attributes":{"title":"Task Stream","child":{"type":"object","name":"Figure","id":"p1639","attributes":{"name":"task_stream","sizing_mode":"stretch_both","x_range":{"type":"object","name":"DataRange1d","id":"p1637","attributes":{"range_padding":0}},"y_range":{"type":"object","name":"DataRange1d","id":"p1638","attributes":{"range_padding":0}},"x_scale":{"type":"object","name":"LinearScale","id":"p1649"},"y_scale":{"type":"object","name":"LinearScale","id":"p1650"},"title":{"type":"object","name":"Title","id":"p1642","attributes":{"text":"Task Stream"}},"renderers":[{"type":"object","name":"GlyphRenderer","id":"p1679","attributes":{"data_source":{"type":"object","name":"ColumnDataSource","id":"p1634","attributes":{"selected":{"type":"object","name":"Selection","id":"p1635","attributes":{"indices":[],"line_indices":[]}},"selection_policy":{"type":"object","name":"UnionRenderers","id":"p1636"},"data":{"type":"map","entries":[["start",[]],["duration",[]],["key",[]],["name",[]],["color",[]],["duration_text",[]],["worker",[]],["y",[]],["worker_thread",[]],["alpha",[]]]}}},"view":{"type":"object","name":"CDSView","id":"p1680","attributes":{"filter":{"type":"object","name":"AllIndices","id":"p1681"}}},"glyph":{"typ
